(341, 1, '855/2017', '04972.005318/2012-92', 1, 'informar sobre as providências adotadas após a fiscalização realizada (Auto de Infração nº 103/COIF/SPU/SC/2013)', 'O que é: Pontal da Figueira, Itapoá - Solicita informações acerca de quais medidas providências/intervenções/medidas foram adotadas pela SPU, após a lavratura do antedito Relatório de Vistoria e auto de infração n° 103/COIF/SPU/SC/2013 (anexos), no caso concreto, visando a reparação do dano ocorrido em área de dominialidade da União.\r\n\r\nO que foi feito:\r\nnão constam outros procedimentos realizados\r\n\r\nO que falta:\r\nverificar com a equipe de fiscalização quanto a quais providências deverão ser adotadas\r\nÚltimo Ofício do MPF: 25/05/2017 \r\n\r\n12/07/2019 - Aguardando manifestação sobre providências adotadas após a fiscalização realizada (Auto de Infração nº 103/COIF/SPU/SC/2013)', '2017-05-18', NULL, '2020-01-06 15:17:55', 1, 3, '2019-05-07 17:19:48', '2020-01-06 15:17:57', 82, 3, 0, NULL, 312),
