(409, 1, '665/2019', '04972.006238/2018-40', 1, 'Informa sobre a concessão da dilação do prazo, em 30 (trinta) dias, para o cumprimento da obrigação de fazer', 'O que é:\r\nNecessidade de demolição de um trapiche de pequeno porte. O Juiz já indeferiu os orçamentos apresentados pelo Município e determinou que fosse realizado pelos autores (União e Município de Bombinhas).\r\n\r\nO que foi feito:\r\n- diversos contatos com Capitania dos Portos, com os quais conseguimos disponibilização de embarção para apoio na remoção\r\n- enviamos Ofício nº 54267/2019/DIGES-SPU-SC/MP à Prefeitura de Bombinhas, solicitando confirmação da demolição\r\n- comunicamos AGU sobre nova tentativa junto à Prefeitura de Bombinhas\r\n\r\nO que falta fazer:\r\n- aguardar resposta da Prefeitura de Bombinhas\r\n- após, verificar com Cristina a cobrança ao Gestor Municipal de Praias.\r\n- após, oficiar AGU', '2019-08-09', '2019-06-10', '2019-09-26 20:26:13', 4, 3, '2019-05-20 17:04:49', '2019-09-26 21:47:26', 100, 3, 1, NULL, 206),
