(457, 1, '234/2019', '04972.006107/2016-09', 1, 'Informe quais medidas foram tomadas quanto aos ranchos de pesca descaracterizados, verificados in loco, na Praia de Itapirubá, em Imbituba, conforme descrito no Relatório de Fiscalização de Território n. 105/2018, notadamente se os RIPs ou TAUS já concedidos foram cancelados, e os que estavam em andamento, negados, encaminhando-se cópia da documentação, caso existente', 'Foi encaminhado o seguinte e-mail à Coordenação e ao NUFIS:\r\n\r\nPrezados,\r\n\r\nO Ofício PRMT/N. 234/2019-GAB2, do Ministério Público Federal, datado de 21/05/2019, nos solicita o seguinte:\r\n\"Visando à instrução do procedimento em epígrafe, solicito-lhe que\r\ninforme quais medidas foram tomadas quanto aos ranchos de pesca\r\ndescaracterizados, verificados in loco, na Praia de Itapirubá, em Imbituba, conforme\r\ndescrito no Relatório de Fiscalização de Território n. 105/2018, notadamente se os\r\nRIPs ou TAUSs já concedidos foram cancelados, e os que estavam em andamento,\r\nnegados, encaminhando-se cópia da documentação, caso existente.\"\r\n\r\n​Em relação a tal solicitação, foi exarado o Despacho SPU-SC-NUREF (4738328), nos seguintes termos:\r\n\r\n​\"Ao NUJUC/SPU-SC,\r\n \r\nRetornamos o presente, informando que até o presente momento não identificamos nenhuma expedição de Termo de Autorização de Uso Sustentável  - TAUS, para os pescadores presentes no objeto desse processo. Informamos ainda que não existe nenhum processo de solicitação de rancho para a área em comento.\r\nDiante disso, o referido processo está sendo enviado ao NUFIS - Núcleo de Fiscalização para continuidade das ações necessárias que o caso requer, e posterior informação ao MPF, requerida no ofício 234/2019 (4010226).\"\r\n\r\nOcorre que, de acordo com o Anexo Relatório Tecnico (4009839), existem Ranchos de Pesca cadastrados sob o regime de ocupação e existiam pedidos de TAUSs em andamento, e um dos questionamentos é se os RIP\'s ou TAUSs já concedidos foram cancelados, e os que estavam em andamento, negados. Tais questionamentos não foram respondidos.\r\n\r\nEm vista disso, solicito que a Cooredenação reanalise o caso e que o NUFIS informe quais medidas deverão ser adotadas nos casos de constatação de irregularidades.\r\n\r\nNUP 04972.006107/2016-09​ - SEI-ME.\r\n\r\n\r\n\r\n\r\n\r\n\r\nAtenciosamente, \r\n \r\nNiarcos Wall Thomaz de Almeida\r\nTécnico Federal de Finanças e Controle\r\nNúcleo de Demandas Jurídicas e de Controle - NUJUC\r\n\r\nSuperintendência do Patrimônio da União em Santa Catarina - SPU-SC', '2019-05-30', '2019-06-27', '2019-11-06 22:13:58', 4, 3, '2019-05-30 18:30:35', '2019-11-06 22:15:23', 65, 3, 0, NULL, 426),
