(631, 1, '861/2016', '04972.002196/2016-14', 0, 'Recomenda que seja executada a sentença da ação, especialmente em relação ao cancelamento das inscrições de ocupação localizadas na praia da Armação do Pântano do Sul - Florianópolis/SC', 'O Ofício do MPF de março de 2016 - A LPM não é homologada no local. Não consta atendimento. Em 5/07/2019, foi encaminhada consulta à AGU solicitando a situação atualizada da ação 5008067-23.2015.4.04.7200 e, se for o caso, o Parecer de Força Executória.', '2016-03-01', NULL, '2019-10-16 15:16:46', 8, 8, '2019-06-21 20:09:53', '2019-10-16 15:16:49', 86, 3, 1, NULL, 614),
