(633, 1, '1760/2018', '04972.004071/2016-11', 1, 'requisito sejam informadas detalhadamente quais medidas foram tomadas pela SPU após a confecção da Nota Técnica n° 11584/2016-MP (anexa), em 17/08/2016, bem assim da Notificação n. 4322451 SPU-SC (anexa) notadamente no que diz respeito ao poder de polícia da SPU, a fim de sanar as irregularidades detectadas.', 'O que é: solicito informação sobre quais medidas administrativas foram adotadas no âmbito dessa Superintendência, diante das informações prestadas por V.Sª através da Nota técnica nº 11419/2016-MP, de que os imóveis estão em área da União <br><br> O que foi feito: O NUP nº 04972.004095/2016-70 (Demanda da AGU), que também trata da Marina Kalemar, além das construções em terreno da União, referente ao PP nº  1.33.005.000494/2015-71, encontra-se relacionado para fiscalização no período de 07/10/2019 a 11/10/2019, constante do Plano Anual Estadual de Fiscalização - PAEF 2019, inserido no processo 04972.001058/2019-52. <br><br> O que falta: Verificar as providências adotadas no NUP 04972.004095/2016-70), pois trata-se da mesma área (Marina Kalemar) apesar de possuir números de ICP diferentes. Não existe LPM homologada. Considerando que versa sobre APP, sugerir o encaminhamento ao órgão ambiental para providências, uma vez que as sanções patrimoniais não podem ser aplicadas em LPM/1831 não homologada.', '2018-11-16', '2018-12-16', '2020-04-21 01:51:48', 8, 3, '2019-06-21 20:22:01', '2020-04-21 01:51:51', 82, 3, 0, NULL, 616),
