(838, 1, '245/2019', '04972.005484/2016-12', 0, 'questiona-se, para fins de celebração de acordo judicial:\na) é viável o recebimento da própria plataforma (pier) como dação em pagamento pelos valores\ndevidos pela ocupação ilícita?\nb) existe possibilidade de eventual cessão do bem a particulares, seja para a própria associação ou para\noutros, com ou sem processo licitatório?\nc) quais seriam eventuais impeditivos ou riscos do recebimento do bem pela União?\nd) Haveria alguma forma de manutenção da propriedade do bem com a Associação, desde que\natendidas determinadas condições?\ne) Qual seria, nesse caso, a modalidade de uso do bem público praia?\nf) Como é que são cedidos regularmente os espaços para outras plataformas de pesca no litoral\ncatarinense ou em outras localidades do Brasil?', 'undefined', '2019-07-18', '2019-08-16', '2019-11-29 17:01:24', 4, 4, '2019-07-25 20:37:29', '2019-11-29 17:01:25', 264, 3, 0, NULL, 796),
