(850, 9, '5021445-80.2014.4.04.7200', '10154.111972/2019-47', 0, 'Intimem-se pessoalmente o Sr. Prefeito Municipal e o Sr. Superintendente da SPU para que o Município e a União cumpram todos os compromissos firmados no prazo de 30 dias, sob pena de aplicação de multa de R$ 10.000,00 ao dia. Demolição ou regularização dos Ranchos de Pesca do Bloco 7 no Município de Florianópolis. Multa ao dia de R$ 10.000,00.', 'Foi realizada Audiência nos seguintes termos:\r\nAberta a audiência, foram as partes instadas à composição do litígio pela via conciliatória, e alertadas sobre a conveniência da referida forma de solução, seja pela sua maior agilidade, seja pela melhor potencialidade de pacificação do conflito trazido a juízo. Após as medidas administrativas adotadas em conjunto pelo Município, FLORAM e União, foi possível identificar as situações dos ocupantes regulares e irregulares dos ranchos existentes na área. A SPU se comprometeu a emitir os TAUS que estão em ocupação regular, no prazo de 60 dias. Aqueles que se encontram em situação irregular já\r\nforam notificados. Os casos que não foram notificados, serão notificados no prazo de 30 dias, para sanar as irregularidades, sob as penas da lei.\r\nO Município se compromete desde já com a demolição do conjunto 4 de ranchos do bloco 7, no prazo de 30 (trinta) dias, com a remoção do entulho. Com relação aos demais pedidos, o Município reitera os pedidos das alegações finais (evento 271).\r\nA Prefeitura requer a expedição de mandado de demolição, com o acompanhamento da SPU. Os prepostos da SPU informaram que vão acompanhar o cumprimento do mandado pelo Município.\r\nAs situações de fragilidades sociais deverão ser resolvidas administrativamente pelas partes.\r\nO MPF requer que as medidas acima elencadas sejam adotadas como\r\nencaminhamento para solução final e, considerando a necessidade de serem esgotadas as\r\npossibilidades de uma composição também para os demais pedidos da ação, propõe a\r\nrealização de uma inspeção conjunta na área, em até 90 dias, bem como de uma audiência a\r\nser fixada no início do mês de dezembro do corrente.\r\nPelo MM. Juiz foi dito: “defiro as medidas solicitadas pelas partes, em especial\r\na demolição do conjunto 4 de ranchos do bloco 7; a entrega dos TAUS e as notificações.\r\nDesigno o dia 19-11-2019, às 14h30 para inspeção judicial; e o dia 10-12-2019, às 14h,\r\npara audiência de conciliação. Revogo a decisão do evento 273\".', '2019-07-26', '2019-08-26', '2019-10-14 17:10:30', 3, 1, '2019-07-29 21:31:20', '2019-10-14 17:10:33', 161, 3, 1, NULL, 804),
