(883, 1, '349/2019', '10154.106101/2019-10', 0, 'a) Se foi realizada nova vistoria em 2018 na área localizada na Rua Wendelim\r\nMetzger, entre as Ruas Oscar de Castilho e Euzébio Piermann, bairro ~cílio Dias,\r\nmunicípio de Canoinhas/SC - se afirmativo, solicita-se o envio do respectivo laudo;\r\nb) Se foi identificado o responsável inicial pela invasão e pelo loteamento irregular da\r\nárea pertencente à União - se afirmativo, solicita-se o fornecimento de seus dados\r\ncompletos de identificação para que se viabilize sua futura oitiva em sede policial;\r\nc) Se foi ajuizada alguma ação para reintegração de posse da área em questão - se\r\nafirmativo, solicita-se seja informado o número do correlato processo judicial para\r\nverificação quanto ao seu estágio atual;\r\nd) Se a área em comento efetivamente ainda integra o patrimônio da União (enviar da\r\ncópia da ficha registrai desse imóvel). Por fim, caso não tenha havido nova fiscalização\r\nem 2018, então, que seja realizada fiscalização com identificação dos invasores\r\n(novos), em data próxima a ser agendada e acompanha por agentes desta Delegacia.', 'PENDENTE - NUINC\r\nReiterado pelo Ofício n.° 1805/2019 - DPF/JVE/SC de 8/07/2019.', '2019-02-25', '2019-08-08', '2019-10-09 21:35:04', 3, 23, '2019-08-02 15:45:28', '2020-04-13 21:27:09', 289, 3, 1, NULL, 823),
