(977, 1, '107/2019', '04972.002115/2017-59', 0, 'se manifeste sobre a proposta de conciliação, ou seja, se haveria possibilidade de regularização da ocupação nos terrenos de marinha e acrescidos, com diminuição da área de preservação no leito do rio, no seguinte modo proposto:\r\n1. Elaboração e execução de PRAD para a área 1 (maior), de modo a que a faixa de preservação a partir do rio seja de 30 metros.\r\n2. Elaboração e execução de PRAD para a área 2 (menor), de modo a que a faixa de preservação a partir do rio seja de 15 metros;\r\n3. como compensação ambiental pela supressão da faixa de APP do leio do rio, a construtora promoveria o custeio do plano de manejo para o Município de Itapema, para cumprimento do Decreto Municipal nº 087/2012, que criou a Unidade de Conservação e Refúgio da Vida Silvestre - ev. 190', 'undefined', '2019-08-26', '2019-09-18', '2019-09-24 21:24:55', 4, 4, '2019-08-28 19:56:06', '2019-09-25 22:01:58', 99, 3, 0, NULL, 905),
