(1341, 1, '720005425916', '14021.111830/2019-46', 0, 'Cumprimentando-o, tendo em vista a necessidade de despropriação de área para\r\nimplantação do contorno viário da região de Florianópolis, solicito que informe, no prazo de\r\n15 (quinze) dias, os limites das terras de marinha (LPM 1831) do rio Aririú em Palhoça (SC),\r\ninformando se há interferência ou não da presente desapropriação em terras de marinha,\r\nsendo o silêncio interpretado como falta de interesse da SPU na área desapropriada e plena\r\nconcordância de que não há interferência de terras de marinha na área em questão.\r\nÁREA TOTAL NECESSÁRIA PARA AS OBRAS (DESAPROPRIAÇÃO):\r\n13.906,14 m²: ÁREA LOCALIZADA NA RODOVIA BR-101 - KM 219, S/Nº, CEP\r\n88.135-011 - BAIRRO PACHECOS - PALHOÇA/SC, anexados no evento 1.', 'undefined', '2019-11-07', '2019-12-02', '2019-11-14 21:27:17', 3, 23, '2019-11-13 20:12:50', '2019-11-18 20:01:41', 329, 3, 0, NULL, 1215),
