(1449, 1, '1576/2019', '04972.001916/2019-69', 1, 'Por meio do Ofício 15762019 (8938574), o MPF está reiterando Ofício 1177/2019 (8865082), juntado ao NUP 04972.001916/2019-69.\r\ninforme se Luciano Ledoux Inácio, CPF 047.169.289-18, atendeu aos termos da Notificação n° 004/2019.', 'PENDENTE - DIIUP FLÁVIA\r\nO que foi feito: Realizada a Fiscalização o ocupante foi Notificado a apresentar documentos que comprovem a regularidade das construções em 30/05/2019.<br>\r\nO que falta fazer: Juntar o Aviso de Recebimento - AR e verificar o atendimento da Notificação. Caso não seja atendida, aplicar as sanções cabíveis.\r\nNot. não recebida -  AR  8841261 /  Renotificar  / Verificar no SPUNet se houve atendimento à Not.e  elaborar resposta mais definitiva ao MPF quanto à impossibilidade de inscrição ex-oficio', '2019-12-22', '2019-12-23', '2020-02-10 17:43:27', 3, 23, '2019-12-04 17:48:24', '2020-02-10 17:43:28', 85, 3, 0, NULL, 439);
