(1539, 1, '9/2020', '04972.002049/2017-17', 0, 'que o Assistente Técnico da União indicado por meio da Nota\r\nTécnica 5020/2019-MP, de 01/03/2019, o Analista de Infraestrutura Juliano Luiz Pinzetta, para que se manifeste sobre\r\no laudo pericial (Seq. 305) até 22/01/2020.', NULL, '2020-01-09', '2020-01-22', '2020-01-23 19:04:51', 3, 4, '2020-01-15 13:44:06', '2020-01-23 19:20:41', 99, 3, 0, NULL, 873),
