(1541, 1, '17/2020', '10154.103205/2020-06', 0, 'que essa Superintendência confirme ou retifique a informação de que\r\no imóvel usucapiendo interfere parcialmente com bem da União (faixa de domínio de extinta linha\r\nférrea). Caso a informação seja confirmada, solicito que: (a) seja apontada em mapa a exata porção do\r\nimóvel usucapiendo que interfere com bem da União; (b) sejam encaminhados os documentos\r\ncomprobatórios da propriedade da União sobre a área.', 'PENDENTE', '2020-01-13', '2020-02-04', '2020-03-13 11:56:42', 3, 3, '2020-01-15 19:29:41', '2020-07-22 14:30:20', 56, 3, 0, NULL, 1373),
