(1546, 1, '9692/2020/ME', '16812.100003/2020-80', 0, 'informações quanto à alegação do executado de que é indevida  a taxa de ocupação constituída pelos processos administrativos 04972 601424/2017-14, 04972 602466/2009-54 e 04972 606833/2013-75.\r\n Diz  que  seu  domicílio  sempre  foi  São  Joaquim-SC.  Alega  que  nunca usufruiu do bem imóvel que lhe é cobrado a taxa de ocupação, contrariando o interesse público ou a legislação patrimonial, o que prevê o artigo 29, bem como incisos III e VIII do artigo 31, tratando-se  de  uma  cobrança  indevida.  Por  fim,  diz  que,  por  mais  que  tivesse  ocupado o imóvel, teria direito a isenção por ser tratar de pessoa de baixa renda (Decreto 1.876/81 em seu artigo 1º e parágrafo 2º).', 'PENDENTE', '2020-01-15', '2020-02-04', '2020-02-05 12:40:21', 3, 3, '2020-01-16 19:26:21', '2020-02-05 12:40:23', 375, 3, 0, NULL, 1377),
