(1813, 2, '078/2018/DZ-GAB', '10154.124994/2020-19', 0, '1) Nos termos do art. 4º da Lei 9.028/1995, solicito análise e manifestação acerca das alegações apresentadas pela parte autora, com fornecimento de informações e elementos de fato e de direito que entenda pertinentes ao caso, com objetivo de bem subsidiar a defesa judicial da União (Fazenda Nacional), conforme detalhamento a seguir.\n2) A parte autora, conforme se depreende da petição inicial, alega que o terreno de marinha objeto do RIP 80450000390-83, inscrito em nome de a pessoa jurídica EXTINTA denominada LULEMMAR Administração e Participações Ltda. (CNPJ 79.083.713/0001-16), teria sido atingido pelo Decreto FUNAI nº 5, de 05/05/2003 (demarcação administrativa de terras indígenas) e, sendo assim, por ter havido perda de domínio em função da \"noticiada expropriação\", não seriam devidas as receitas públicas que estão sendo cobradas (taxa de ocupação). Em face de tais alegações, para bem encaminhar-se a defesa da UNIÃO (FAZENDA NACIONAL) em juízo, é necessário colher manifestação conclusiva, e respectivos subsídios, junto à autoridade competente (SPU/SC) para os atos administrativos que estão sendo judicialmente questionados.\n3) A manifestação ora requisitada deve vir acompanhada com cópia integral do(s) processo(s) administrativo(s) envolvido(s) e demais documentos administrativos relacionados ao caso (digitalizados, preferencialmente via SEI), muito especialmente a resposta ao requerimento administrativo (s.m.j., indeferimento devidamente fundamentado) objeto do Atendimento nº SC02569/2019.', 'undefined', '2020-03-24', '2020-04-30', '2020-04-03 18:26:30', 23, 4, '2020-04-03 18:24:56', '2020-04-03 20:18:47', 122, 3, 0, NULL, 1580),
