(1848, 1, '0790/2020', '10154.106101/2019-10', 0, '\"a) Se foi realizada nova vistoria em 2018 na área localizada na Rua Wendelim Metzger, entre as Ruas Oscar de Castilho e Euzébio Piermann, bairro Marcílio Dias, município de Canoinhas/SC - se afirmativo, solicita-se o envio do respectivo laudo;\nb) Se foi identificado o responsável inicial pela invasão e pelo loteamento irregular da área pertencente à União - se afirmativo, solicita-se o fornecimento de seus dados completos de identificação para que se viabilize sua futura oitiva em sede policial;\nc) Se foi ajuizada alguma ação para reintegração de posse da área em questão - se afirmativo, solicita-se seja informado o número do correlato processo judicial para verificação quanto ao seu estágio atual; \nd) Se a área em comento efetivamente ainda integra o patrimônio da União (enviar da cópia da ficha registrai desse imóvel). Por fim, caso não tenha havido nova fiscalização em 2018, então, que seja realizada fiscalização com identificação dos invasores (novos), em data próxima a ser agendada e acompanha por agentes desta Delegacia\".', 'undefined', '2020-04-13', '2020-04-22', '2020-04-23 22:24:11', 23, 3, '2020-04-13 21:22:57', '2020-04-30 19:53:34', 364, 3, 1, NULL, 823),
