(1981, 1, '1506/2020', '0983.000734/82-38', 0, 'Encaminha PARECER DE FORÇA EXECUTÓRIA n. 00151/2020/PGU/AGU', 'Trata o presente do PARECER DE FORÇA EXECUTÓRIA n. 00151/2020/PGU/AGU (8182801) que informa o seguinte:\r\n\r\n\"Em atenção aos termos do Ofício nº 7468/2017 – MP, foi expedido o Ofício n. 00154/2017/PGU/AGU reiterando o quanto contido na Nota de Força Executória nº 449/2016, oportunidade em que restou consignado que qualquer alteração no âmbito do STJ seria oportunamente comunicada a essa Superintendência.\r\nFoi objeto de julgamento o agravo interno interposto pela União nos autos do recurso especial em tela, tendo o Ministro Relator reconsiderado a decisão objeto da força executória exarada na referida Nota nº 449/2016.\r\nTal decisão havia provido o recurso especial dos particulares para declarar a nulidade do procedimento de demarcação do terreno de marinha e consequente inexigibilidade da taxa de ocupação quanto ao imóvel descrito na petição inicial - Registro Imobiliário Patrimonial nº 80390000017-74.\r\nA atual decisão determinou a baixa dos autos para julgamento dos embargos de declaração opostos pelos particulares, notadamente sobre a nulidade do procedimento de demarcação diante da ausência de notificação pessoal, bem como a inexigibilidade da taxa de ocupação.\r\nNeste contexto, verifica-se que o cenário foi alterado, não mais subsistindo a força executória exarada através da Nota de Força Executória nº 449/2016.\"\r\n\r\nA Nota de Força Executória nº 449/2016 informava o seguinte:\r\n\r\n\"Verifica-se que foi provido o recurso especial dos particulares para declarar a nulidade do procedimento de demarcação do terreno de marinha e consequente inexigibilidade da taxa de ocupação quanto ao imóvel descrito na petição inicial - Registro Imobiliário Patrimonial n° 80390000017-74.\"\r\n\r\nAssim, entendemos, salvo melhor juízo, que deixou de ser nulo o procedimento demarcatório e que não são mais inexigíveis as taxas de ocupação em relação ao imóvel cadastrado sob o RIP 80390000017-74.\r\n\r\nIsso posto, encaminhe-se à Coordenação e ao NUREP para adoção das providências cabíveis.', '2020-05-20', NULL, '2020-07-23 10:09:33', 39, 3, '2020-05-21 13:45:29', '2020-07-23 10:09:38', 394, 3, 0, NULL, 1685),
(1982, 1, '00461/2020', '04972.001955/2019-66', 0, 'informar se há interferência da(s) área(s) objeto do feito com propriedade da União e em que medida, considerando o patrimônio federal. Caso positivo, informar também sobre a existência de eventual título de ocupação do(s) imóvel(eis) de que se trata e, ainda, se no local há LPM demarcada/homologada. Conveniente\r\ntambém anexar às informações o mapa correspondente à(s) área(s).', 'Foi encaminhado Ofício à AGU nos seguintes termos:\r\nEm atenção ao OFÍCIO n. 00461/2020/GEPAM/PUSC/PGU/AGU, informamos que, para que possamos encaminhar informações complementares às contidas na Nota Técnica nº 7967/2019-MP, referentes à interferência da(s) área(s) objeto do feito com propriedade da União e em que medida, considerando o patrimônio federal, bem como sobre a existência de eventual título de ocupação do(s) imóvel(eis) de que se trata, faz-se necessário o encaminhamento de planta que delimite qual foi a área objeto da desapropriação do processo 0313746-17.2018.8.24.0023.\r\n\r\nInformamos, também, que para o local a LPM está demarcada mas ainda não homologada.', '2020-05-21', '2020-06-05', '2020-06-02 13:40:04', 23, 3, '2020-05-21 22:24:50', '2020-06-02 14:49:59', 100, 3, 0, NULL, 186),
(1983, 1, '00462/2020', '10154.137765/2020-56', 0, 'informar se de alguma forma, em que medida, se for o caso, há interesse da União integrar o feito, considerando seu patrimônio.\nInformar também sobre eventual título de ocupação da área de que se trata e se, no local, há LPM demarcada/homologada', NULL, '2020-05-21', '2020-06-22', '2020-06-24 14:47:34', 23, 4, '2020-05-21 22:35:40', '2020-06-24 14:47:37', 108, 3, 0, NULL, 1686),
