(1985, 1, '00467/2020', '10154.137966/2020-53', 0, 'designação de servidor para o acompanhamento do referido ato de formalização da desocupação no dia 27/05/2020, às 11:00 horas, no local do imóvel.\nNa oportunidade, à vista da condenação da empresa ao pagamento de indenização pela ocupação ilícita, em valor correspondente a 10% (dez por cento) do valor atualizado do domínio pleno do terreno por ano ou fração de ano em que a União tenha ficado privada da posse ou ocupação do imóvel, solicito sejam apresentados os dados para elaboração da conta visando sua cobrança.', NULL, '2020-05-22', '2020-05-26', '2020-06-08 13:44:08', 23, 3, '2020-05-22 19:40:28', '2020-06-08 13:44:12', 100, 3, 0, NULL, 1687),
