(1990, 1, 's/n', '10154.138258/2020-30', 0, 'A Unidade Virtual da 4ª Região da PGFN encaminhou, por meio do \"Formulário: Solicitação de Subsídios à Secretaria de Patrimônio da União em Santa Catarina (SPU-SC)\", Anexo formulário (8245046), a seguinte exposição dos pontos controvertidos e fatos relevantes:\r\n\r\n\"O contribuinte ingressou judicialmente pleiteando a nulidade dos lançamentos efetuados em face do mesmo objetos das CDAs 91.6.04.000397-79, 91.6.06.023730-25 e 91.6.08.008032-80 correspondentes à taxa de ocupação cobrada pela SPU referente ao imóvel RIP 8143000002104. Afirma, para tanto, que já restou reconhecido administrativamente pela SPU que citado imóvel não pertence à União.\r\n\r\nDesta feita, solicita-se subsídios para manifestação sobre a demanda do autor.\r\n\r\nA exiguidade do prazo ocorre em razão de despacho judicial determinando a manifestação da União em cinco dias em regime de urgência sobre o pedido de tutela.\"\r\n\r\nEm vista disso, encaminhamos o presente NUP ao NUREP para prestar as informações solicitadas pela PGFN, com urgência, até 31/05/2020.', NULL, '2020-05-25', '2020-05-31', '2020-05-29 14:23:27', 23, 3, '2020-05-25 18:33:07', '2020-05-29 17:55:03', 308, 3, 0, NULL, 1691),
