(2005, 4, '488/2020', '04972.006629/2016-01', 0, 'Em complementação ao OFÍCIO n. 00103/2020/PSU/CCO/PGU/AGU, que encaminhou o\r\nPARECER DE FORÇA EXECUTÓRIA n. 00010/2020/GEPAM/PUSC/PGU/AGU versando sobre decisão\r\nproferida em Agravo de Instrumento no TRF da 4ª Região interposto por esta Procuradoria em face de\r\ndecisão proferida nos autos Ação de Cumprimento de Sentença nº 5027598-32.2014.4.04.7200 (Campo\r\nde Aviação - Campeche), encaminho decisão proferida pelo Juízo da 6ª Vara Federal de Florianópolis que\r\ncontém o seguinte teor:\r\n1. No Agravo de Instrumento n. 5006677-11.2020.4.04.0000, restou decidido:\r\nAnte o exposto, defiro o pleito liminar para suspender a decisão do evento 218 no ponto\r\nem que determina à UNIÃO \"complemente o estudo já apresentado com diligências in loco,\r\na fim de identificar todas as ocupações informais (clandestinas) eventualmente existentes\r\nna área total do antigo Campo de Aviação do Campeche\".\r\nO despacho do Evento 218, determinou:\r\n1. identifique o último lote que tem sobreposição com o Casarão dos Pilotos e, por\r\nconseguinte, ainda promova todas as medidas indispensáveis para garantir a salvaguarda\r\ndo bem histórico;\r\n2. complemente o estudo já apresentado com diligências in loco, a fim de identificar todas\r\nas ocupações informais (clandestinas) eventualmente existentes na área total do antigo\r\nCampo de Aviação do Campeche;\r\n3. junte aos autos o \"Mapa de Identificação das Matrículas\" (8921229).\r\nAs alegações da União de que a obrigação imposta a ela já foi cumprida não prospera. O\r\nacórdão em recurso de apelação assim esclareceu:\r\nEntretanto, no que diz com a condenação da UNIÃO de providenciar a retirada de\r\nparticulares que ocupam irregularmente imóveis erguidos à época da criação do Campo de\r\nAviação do Campeche, em especial a Casa dos Pilotos, agora tombada, trata-se de\r\ncondenação que de fato deve ser mantida (pedido \'d\' da exordial). Destaque-se que a\r\nocupação de bem da UNIÃO, mesmo que tombado, por seu próprio staf, não está abarcado\r\npela condenação. Ou seja, hígida a presença de Base da Aeronáutica no local. Entretanto, a\r\ndeterminação de desocupação para uso particular residencial não está atrelada a qualquer\r\ndeterminação para instalação no local de um museu ou qualquer outra estrutura, tal como\r\nfundamentado supra, refoge à competência do Judiciário.\r\nAssim, concedo à executada União o prazo de 30 (trinta) dias para comprovar o\r\ncumprimento integral das determinações 1 e 3, da decisão do Evento 218, sob\r\npena de aplicação de pena de multa no valor de R$ 10.000,00 (Dez mil reais).\r\n2. A sentença exequenda, não modificada pelo Tribunal, determinou, ainda:\r\nDetermino, por fim, seja averbada, nas matrículas dos imóveis que compõem o terreno\r\nobjeto da lide, a existência desta ação civil pública e da presente sentença.\r\nDiante disso, defiro o pedido do MPF do Evento 198, e determino à Secretaria que expeça\r\nofício ao Cartório do 2º Ofício de Registro de Imóveis de Florianópolis, a fim de que efetue a\r\naverbação dos dados identificadores desta ação, da sentença judicial e do acórdão na\r\nmargem das matrículas dos imóveis que compõem a integralidade da área objeto desta lide\r\n(área total de 352.267,9604m² - Matrícula originária nº 7.216).\r\nA decisão, assim, determina o prazo de 30 (trinta) dias para a União comprovar o\r\ncumprimento integral das determinações 1 e 3, da decisão do Evento 218, sob pena de aplicação de\r\npena de multa no valor de R$ 10.000,00 (Dez mil reais). Tais determinações são as seguintes:\r\n1. identifique o último lote que tem sobreposição com o Casarão dos Pilotos e, por\r\nconseguinte, ainda promova todas as medidas indispensáveis para garantir a salvaguarda\r\ndo bem histórico;\r\n(...)\r\n3. junte aos autos o \"Mapa de Identificação das Matrículas\" (8921229\r\nÀ vista disso, solicito que sejam encaminhados a esta Procuradoria os comprovantes de\r\ncumprimento da decisão até o dia 15/06/2020.', 'Houve a prorrogação do prazo por mais 60 dias - Anexo Resposta da AGU Deferimento de Dilação (8691876). Novo Prazo 15/08/2020.', '2020-05-26', '2020-08-15', '2020-08-18 11:49:18', 3, 3, '2020-05-27 17:20:55', '2020-08-19 07:40:11', 100, 3, 1, NULL, 651),
