(2121, 1, '146050/2020', '16537.100068/2020-21', 0, 'Cancelamento de cadastro e de débitos.\r\n\r\nEncaminhamos o presente NUP ao NUREP pra atender ao OFÍCIO SEI Nº 146050/2020/ME (8703297), que informa o teor e solicita  cumprimento de sentença transitada em julgado no p. 5010366-33.2016.4.04.7201, chave de acesso 420918767316, promovido por ORNELA BARBARA ZARA VON ARKIS (INVENTARIANTE), CPF 008.681.358-79 e EUGENIO WALDY VON ARKIS (ESPÓLIO), CPF 013.013.798-75, perante a 2ª Vara Federal de Joinville.\r\n\r\nEis a parte do dispositivo da sentença que transitou em julgado e que demanda observância por parte da SPU/SC:\r\n\r\n \r\n\r\nAnte o exposto, julgo procedentes os pedidos a fim de:\r\n\r\n \r\n\r\na) declarar a inexistência de relação jurídico-administrativa de ocupação sobre bem público federal, referente aos imóveis identificados como lotes 44 e 45, da quadra D, no loteamento \"Concha do Mar\", atual RIP´s 8025010013686, situados no Município de Barra do Sul/SC, desde o ano de 1995; e\r\n\r\n \r\n\r\nNa sequência, ao apreciar embargos de embargos de declaração, o r. juízo federal retificou “o item a do dispositivo da sentença 246:1 para indicar que os RIPs a que se referem o aludido item são os de números 8025.0000.533-59 (lote 44) e 8025.0000.534-30 (lote 45), da quadra D, no loteamento \"Concha do Mar\", situados no Município de Barra do Sul/SC.”', NULL, '2020-06-18', NULL, '2020-10-27 09:00:04', 3, 8, '2020-06-22 18:40:34', '2020-10-27 09:00:08', 20, 3, 1, NULL, 667),
