(2134, 8, '5008002-49.2020.4.04.7201', '10154.146875/2020-17', 0, 'Trata-se de mandado de segurança nº 5008002-49.2020.4.04.7201, impetrado por Município de Itapoa contra ato do Superintendente da Secretaria de Patrimônio da União em Florianópolis/SC, pleiteando, em sede liminar, provimento jurisdicional para suspender \"quaisquer atos de execução judicial ou extrajudicial dos valores constantes na dívida ativa nº 91 6 20 009672-25, nº do processo 04972 001326/2019-36 (art. 7º, inciso III, Lei 12.016/09), originada pelo auto de infração nº 002/2014/COIF/SPU/SC\".\r\n\r\nComo provimento final, requer a concessão da segurança para \"suspensão da exigibilidade da cobrança, face os argumentos de fato e direito desta petição inicial, dos valores constantes na dívida ativa nº 91 6 20 009672- 25, nº do processo 04972 001326/2019-36 (art. 7º, inciso III, Lei 12.016/09), originada pelo auto de infração nº 002/2014/COIF/SPU/SC\".\r\n\r\nRelata ter recebido em 28.01.2014 o Ofício 0155/2014/GAB/COIFI/SPU/SC, comunicando o envio de Auto de Infração n. 002/2014/COIFI/SPU/SC, aplicado por suposta \"delimitação de área de uso comum do povo, sem a devida Permissão de Uso, emitida pela Superintendência do Patrimônio da União em SC, conforme Lei 9.636, de 15 de maio de 1998\".\r\n\r\nAfirma que lhe foi aplicada multa, sem exercício de contraditório e ampla defesa, razão pela qual somente obtém certidão positiva de débitos, o que ocasiona prejuízos à coletividade, porquanto a dívida foi inscrita em dívida ativa e lançada no Cadastro Informativo dos Créditos não Quitados do Setor Público Federal - CADIN, mantido pelo Sistema de Informações do Banco Central do Brasil - SISBACEN.\r\n\r\nE, em virtude da \"inadimplência\", estaria impossibilitado de realizar operações de crédito em andamento com a CEF (PVL 02.003160/2016-17, Processo 17944103197/2007-07) e assinar convênios com a União (proposta 5979/2020 –  Estruturação da Rede de Serviços do Sistema Único de Assistência Social – SUAS, no valor de R$380.409,00 e a proposta n. 1354/2020 – Implantação de Pavimentação Urbana no valor de R$287.306,00).\r\n\r\nSustenta ter delimitado área de uso comum do povo para realização do evento gratuito e destinado ao público em geral denominado “Projeto Verão + esporte e diversão”. Entretanto, que o \"croqui\" da suposta área ocupada é imagem aleatória do litoral da cidade, sem qualquer laudo técnico que o embase, e o auto de infração encontra-se assinado por 1(um) técnico de nível superior (SIAPE 1574367) e 1(uma) testemunha.\r\n\r\nPor meio do Mandado de Notificação (8804244), esta Superintendência foi intimada para prestar, em 10 (dez) dias, as informações que julgar necessárias quanto aos fatos alegados no processo em referência, nos termos do art. 7º, da Lei nº 12.016/2009.', NULL, '2020-06-23', '2020-07-03', '2020-07-06 17:38:00', 3, 3, '2020-06-24 14:53:19', '2020-07-06 17:38:03', 400, 3, 0, NULL, 1768),
(2135, 1, '6541301/20220', '10154.154890/2019-97', 0, 'informar que em razão da \"Notícia de Fato n. 1.33.005.000803/2019-36\" a Secretaria de Infraestrutura Urbana emitiu o Ofício SEINFRA.GAB SEI nº 5666216, cuja cópia se faz anexar, protocolando-o no Ministério Público Federal em 13/02/2020. Destaca-se que a Secretaria de Infraestrutura Urbana de Joinville não possui qualquer atribuição sobre o denominado \"Trapiche da Vigorelli\", mesmo porque encontra-se implantado em área de responsabilidade patrimonial da União.', 'Verificar documentos encaminhados', '2020-06-24', NULL, '2020-07-22 13:24:05', 23, 3, '2020-06-24 17:45:37', '2020-07-22 13:24:16', 401, 3, 0, NULL, 1332),
