(2423, 1, '1011 e 1012 /2020', '10154.167304/2020-16', 0, 'Em complemento às informações contidas no Despacho SPU-SC-NUJUC (10232771), informo que no OFÍCIO n. 01012/2020/GEPAM/PUSC/PGU/AGU, consta o seguinte:\r\n\r\n\"Trata-se de Ação de Cumprimento de Sentença referente a seguinte decisão proferida nos autos acima enumerados.\r\n\r\nA parte autora entrou com o pedido de Cumprimento de Sentença, nos termos seguintes:\r\n\r\nAssim, considerando que ocorreu o trânsito em julgado da condenação, o MPF requer seja determinada a intimação da UNIÃO, para:\r\n\r\natravés de regular processo administrativo, no prazo de1 ano, promover a demarcação,\r\ncadastramento e fiscalização, por intermédio da SPU/SC, de todos os imóveis localizados\r\nem terrenos de marinha e acrescidos, abrangidos na área Lagoa de Garopaba,Praia da\r\nFerrugem, Município de Garopaba/SC -Loteamento Ludwig II, sob pena de fixação de\r\nmulta diária de R$500,00 (quinhentos reais) para o caso d e descumprimento,\r\nsem prejuízo da verificação d a s sanções cíveis e criminais no caso. (destaque\r\nnosso).\r\n\r\nRatificamos que a resposta deve conter a descrição das diligências que serão adotadas para cumprimento, bem como a data de seu início e, se possível, a previsão do final.\r\n\r\nAssim, solicitamos à SPU especial atenção ao cumprimento da determinação judicial.\r\n\r\n E considerando a existência de prazo judicial para manifestação, solicito que a resposta seja encaminhada a esta Procuradoria da União em Santa Catarina até o dia 10/09/2020.\"\r\n\r\nJá o OFÍCIO n. 01011/2020/GEPAM/PUSC/PGU/AGU, encaminha o PARECER DE FORÇA EXECUTÓRIA n. 00046/2020/GEPAM/PUSC/PGU/AGU.\r\n\r\nO referido Parecer informa que foi proferida decisão no processo judicial 5001742-52.2013.4.04.7216, que transitou em julgado em 07/08/2020 e que com a baixa dos autos o Ministério Público Federal deu início a fase de cumprimento de Sentença.\r\n\r\nQue, desse modo, atesta que a decisão é dotada de exequibilidade imediata, devendo ser cumprida pela Pasta, nos termos determinados pelo Juízo e pleiteado pelo MPF na inicial de cumprimento de Sentença:\r\n\r\n\"Assim, considerando que ocorreu o trânsito em julgado da condenação, o MPF requer seja  determinada a intimação da União para:\r\n\r\natravés de regular processo administrativo, no prazo de 1 ano, promover a demarcação, cadastramento e fiscalização, por intermédio da SPU/SC, de todos os imóveis localizados em terrenos de marinha e acrescidos, abrangidos na área Lagoa de Garopaba, Praia da Ferrugem, Município de Garopaba/SC - Loteamento Ludwig II, sob pena de fixação de multa diária de R$ 500,00 (quinhentos reais) para o caso de de descumprimento, sem prejuízo da verificação das sanções cíveis e criminais no caso.\"\r\n\r\nPor fim, ressalta, conforme acima transcrito, que o cumprimento da obrigação está atrelado a pena de multa diária, pelo descumprimento, no valor de R$500,00 (quinhentos reais).\r\n\r\nIsso posto, proponho pelo encaminhamento do presente processo à Coordenação, ao NUPRIV e ao NUFIS para que prestem as informações solicitadas até o dia 10/09/2020 e adotem as providências para o inteiro cumprimento da decisão.', 'Lagoa de Garopaba,Praia da Ferrugem, Município de Garopaba/SC -Loteamento Ludwig', '2020-08-28', '2020-09-10', '2020-09-15 10:54:32', 39, 23, '2020-08-31 17:46:19', '2020-09-15 14:47:17', 106, 3, 1, NULL, 1971),
(2424, 1, '01029/2020', '10154.167636/2020-92', 0, 'informações que possibilitem a defesa da União, informando se há interferência da(s) área(s) objeto do feito com propriedade da União e em que medida, considerando o patrimônio federal. Informar também sobre a situação dos imóveis que correspondem aos RIPs citados - Se a área, de fato, se enquadra no\nconceito de terreno de marinha e, ainda, se no local há LPM demarcada/homologada. Conveniente também anexar às informações o mapa correspondente à(s) área(s). E, por fim, outras informações (técnicas) que achar pertinentes a uma boa defesa do ente federal.', NULL, '2020-08-31', '2020-09-15', '2020-09-21 06:40:08', 23, 39, '2020-08-31 19:47:40', '2020-09-21 06:40:10', 106, 3, 0, NULL, 1972),
