(2535, 1, '1423/2020', '10154.153471/2020-71', 0, 'Trata o presente do Ofício nº 1423/2020-GAB5-FPS, que, em resposta ao nossos ofícios SEI Nº 177592/2020/ME e SEI Nº 209124/2020/ME, nos encaminha a cópia integral dos autos do Procedimento Administrativo de acompanhamento de Instituições nº 1.33.005.000361/2020-61,e solicita o encaminhamento das informações solicitadas pelo ofício n. 1.058/2020.\r\nO Ofício nº 1058/2020-GAB5-FPS, havia solicitado que, por meio de ofício circunstanciado, informe, encaminhe, esclareça, acompanhado dos respectivos documentos comprobatórios:\r\nI. Sobre a situação da construção ilegal/irregular situada na Rua Osmar Galm n. 37, junto ao Rio Barrinha, bairro Itajuba, CEP: 89.390-000, Barra Velha/SC, notadamente no que diz respeito ao resultado do Auto de Infração n. 006/2019, tendo por finalidade demolição e/ou remoção de aterro, obra, cercas ou demais benfeitorias e aplicação de multa e as providências judiciais e/ou extrajudiciais adotadas pelo Órgão para dar-lhe cumprimento;\r\nII. Informe sobre eventuais óbices à execução do Auto de Infração e das medidas administrativas e/ou judiciais adotadas pelo Órgão para dar-lhe cumprimento;\r\nIII. Caso ainda não tenha havido o cumprimento/execução do Auto de Infração lavrado em face de Adilson Zermiani, que informe se foram adotadas providências judiciais e/ou administrativas em face do Município de Barra Velha/SC, considerando a informação registrada no item 9.5. da ORDEM DE FISCALIZAÇÃO N. O13/2019 – SPU, de que a área em tela encontra-se cadastrada em nome da Prefeitura Municipal de Barra Velha; e\r\nIV. Preste outras informações que reputar relevantes ao deslinde do feito.\r\nPor fim, fixa o prazo de 90 (noventa) dias para o encaminhamento das informações solicitadas.\r\nIsso posto, encaminhe-se ao NUFIS para análise e manifestação.', NULL, '2020-09-11', '2020-11-19', '2020-10-20 19:35:16', 3, 3, '2020-09-22 12:52:22', '2020-10-20 19:35:18', 68, 3, 0, NULL, 2036),
