(2656, 1, '537/2020', '04972.006391/2018-77', 0, 'Trata o presente do OFÍCIO n. 00537/2020/CONJUR-MDR/CGU/AGU, referente à Ação Civil Pública n. 5014004-09.2018.4.04.7200 que condenou a União realizar a manutenção dos equipamentos da Barragem Oeste e limpeza dos entulhos e desassoreamento da entrada das comportas, enquanto não se concretizar a transferência definitiva do encargo ao\r\nEstado de Santa Catarina, com base no art. 269, II e 329 do Código de Processo Civil de 1973 e fixou multa diária de 500 BTNs, para o caso de descumprimento da sentença, em execução específica, com arbitramento do valor do serviço à entidade executante.\r\n\r\nVisando subsidiar a defesa dos interesses da União no referido processo judicial, a CJU solicita à que seja informado, até o dia 13.10.2020, o estágio atual do processo de doação da Barragem de Taió para o Estado de Santa Catarina.\r\n\r\nIsso posto, encaminhe-se à NUDEPU para prestar as informações.', NULL, '2020-10-08', '2020-10-30', '2020-10-26 17:08:07', 3, 3, '2020-10-23 09:09:27', '2020-11-04 08:32:20', 420, 3, 0, NULL, 175),
