(2695, 9, '5026964-94.2018.4.04.7200', '10154.184788/2020-50', 0, 'd) da União, por meio da SPU, para que, no prazo de sete dias, preste informações justificadas,\r\nacompanhadas de todas as provas documentais, sobre as razões da falta de manifestação adequada no procedimento\r\nadministrativo demarcatório (a pandemia não pode ser uma escusa minimamente aceitável, com a devida vênia) -\r\nespecialmente ao se considerar que a Comunidade Quilombola Vidal Martins vem sofrendo particularmente com os\r\nimpactos da pandemia da CoViD-19 e que seu território compreende, entre tantos outros, bens da União (e.g., terrenos e\r\nacrescidos de marinha, margens de corpo hídrico sujeito à influência da maré, i.e., a Lagoa da Conceição), etc. - bem como\r\npara que, no mesmo lapso, assuma o compromisso de integrar o eventual grupo interinstitucional que venha a ser\r\nconstituído ou, então, de participar efetivamente de solução equivalente de autocomposição.', NULL, '2020-10-28', '2020-11-06', '2020-11-12 05:48:32', 3, 39, '2020-10-29 11:37:06', '2020-11-12 05:48:34', 161, 3, 0, NULL, 2111),
