(2711, 9, '5018915-93.2020.4.04.7200.', '10154.167627/2020-00', 0, '\"A impetrante informa que o impetrado não juntou aos autos a comprovação do cumprimento da liminar e requer a intimação da autoridade coatora para que reanalise o pedido de restabelecimento das inscrições de ocupações, haja vista que a documentação por ela perquirida há muito já foi juntada, inexistindo de fato qualquer óbice para o regular andamento do processo administrativo 04972.002398/2017-39 e apensos, com a fixação de astreinte no valor mínimo de R$ 1.000,00 por dia de descumprimento (Evento 24).\r\n\r\nDiante disso, intime-se por mandado o impetrado para que, no prazo de 5 dias, comprove nos autos o cumprimento da liminar (Evento 12), sob pena de aplicação de multa de R$1.000,00, em caso de descumprimento.\"', 'Atendido pelo Ofício 280027 (11592135) - Anexo Peticionamento via e-proc (11608267)', '2020-11-03', '2020-11-10', '2020-11-06 12:35:23', 3, 3, '2020-11-04 07:22:15', '2020-11-06 12:35:26', 161, 3, 1, NULL, 1977),
