(2746, 1, '01493/2020', '10154.176960/2020-00', 0, 'em atenção ao Ofício SEI n. 270604/2020/ME, solicita informações complementares quanto à interferência da área vindicada, já que a manifestação que consta como anexa ao aludido expediente informa a pendência de oitiva de servidores da extinta RFFSA lotados em outra cidade. Diante disso, impende manifestação\nconclusiva da SPU, se for o caso, adotando as medidas necessárias junto ao escritório de Tubarão. \nO prazo judicial é preclusivo, razão pela qual o não atendimento ensejará prejuízos irreparáveis à União. Diante disso, solicita que a resposta seja encaminhada impreterivelmente até o dia 23-11-2020.', NULL, '2020-11-13', '2020-11-20', '2020-11-23 11:28:17', 23, 39, '2020-11-13 16:29:24', '2020-11-23 11:28:21', 114, 3, 0, NULL, 2051),
