(2749, 6, '00058/2020', '04972.006230/2011-15', 0, 'PARECER DE FORÇA EXECUTÓRIA\nAs decisões liminares proferidas neste processos foram superadas pela sentença de mérito. Essa, por sua vez, encontra-se suspensa por decisão do TRF da 4ª Região. Portanto, não há decisão com força executória a ser observada pela União neste momento.', NULL, '2020-11-16', NULL, '2020-11-16 15:49:28', 23, 23, '2020-11-16 15:49:10', '2020-11-16 15:49:31', 100, 3, 1, NULL, 643),
