(2258, 1793, 5, '2020-05-12 17:56:15', '2020-05-12 17:56:15', 'O Ofício  n. 00207/2020/GEPAM/PUSC/PGU/AGU, trata da Ação Civil Pública nº 5010226-65.2017.4.04.7200, cujos trâmites administrativos encontram-se registrados nos processos 04972.002691/2017-04 e 04972.007752/2017-11 que atualmente encontram-se no SEI-MP.\nDiante do exposto, restituímos o presente para que seja providenciado o barramento de ambos os processos, e  a inserção do Ofício  n. 00207/2020/GEPAM/PUSC/PGU/AGU no processo 04972.002691/2017-04, a fim de garantir a uniformidade dos trâmites administrativos.\nApós, retorne para análise e manifestação.', NULL, 'Modules\\Auth\\Entities\\DivisaoOrganograma', 14),
(2259, 1926, 5, '2020-05-21 13:32:32', '2020-05-21 13:32:32', 'Em atenção ao Despacho SPU-SC-NUJUC 7976530, considerando os termos do Ofício 00402/2020 (7976499), restituímos o presente para que seja verificada a interferência da área objeto da ação com a área de propriedade da União conhecida como Barragem Oeste, em Taió/SC, as qual encontra-se identificada nas plantas 5541068 e 5541145 retiradas do NUP 11452.001570/95-50.\r\n\r\nA fim de contribuir com a identificação da sobreposição anexamos ao presente o Anexo Identificação da área Barragem Oeste (8004498), retirado dos autos judiciais.\r\n\r\nRessaltamos que consta dos autos a manifestação do Estado de Santa Catarina, de que a área objeto sobrepõe a área de propriedade da União, fato este que justifica o interesse da União no feito. Caso reste verificado a não interferência da área da ação com o imóvel de propriedade da União, não vislumbramos interesse dessa SPU/SC na causa.', NULL, 'Modules\\Auth\\Entities\\DivisaoOrganograma', 14),
