(1212, 3, 1, '5001367-45.2017.4.04.7205', 'Manifestação de Interess', 'Dirijo-me a V. Sa nos termos e aos fins do art. 4º da Lei n. 9.028/95, para solicitar que\r\njunte os autos croqui, contendo tanto a identificação/localização do terreno de 549,00m²\r\n(matrícula 9.886) como a identificação/localização da construção objeto do auto de embargo\r\njuntado ao evento 01, LAUDO3, p. 05. O croqui deve ser instruído com fotos atualizadas da\r\nobra e do seu entorno (frente e laterais), conforme determinado pelo Juízo, nos termos a seguir\r\ntranscritos: “...intime-se o Município de Gaspar e a União para, no prazo de 15 dias, acostarem ao autos croqui,\r\nsemelhante ao trasladado para estes autos nos termos do item 2 supra, que contenha tanto a\r\nidentificação/localização do terreno de 549,00m² (matrícula 9.886) como a identificação/localização da\r\nconstrução objeto do auto de embargo juntado ao evento 01, LAUDO3, p. 05. O croqui deve ser instruído\r\ncom fotos atualizadas da obra e do seu entorno (frente e laterais).”', '503360765917', '2019-11-12 20:19:19', '2019-11-12 20:19:19'),
