(1230, 3, 1, '5008220-37.2012.4.04.7208', 'Trata-se de ação ordinária proposta por HOTÉIS ITAPEMA LTDA e outro perante o MUNICÍPIO DE ITAPEMA e UNIÃO, com o fim de o Município-réu se abstenha d', 'Trata-se de ação ordinária proposta por HOTÉIS ITAPEMA LTDA e outro perante o MUNICÍPIO DE ITAPEMA e\r\nUNIÃO, com o fim de o Município-réu se abstenha de concretizar obras e construções nas áreas objeto da presente ação,\r\nantes por eles detidas, ao mesmo tempo em que buscam sua inscrição como ocupantes junto à Secretaria do Patrimônio da\r\nUnião - SPU.', '154889051512', '2019-11-19 16:30:02', '2019-11-19 16:30:02'),
(1238, 2, 1, '5002740-10.2019.4.04.7216', 'Solicita subsídios fáticos e jurídicos', 'ACP para promover a defesa ambiental de parcela territorial da costa litorânea catarinense, localizada no Município de Laguna/SC, na localidade denominada Praia da Ilhota/Ypuã, em razão de imóveis construídos em Área de Preservação Permanente, Área de Proteção Ambiental da Baleia Franca e Acrescidos de Marinha.', 'undefined', '2019-11-19 21:00:22', '2019-11-19 21:00:22'),
(1239, 2, 1, '5011961-41.2019.4.04.7208', 'Demolição da obra nominada de “Rancho dos Pescadores” no município de Itapema, SC', 'Solicita que sejam fornecidos todos os subsídios de fato e de direito sobre o tema em questão.', '392311785819', '2019-11-20 16:12:33', '2019-11-20 16:12:33'),
(1241, 3, 4, '5016460-29.2018.4.04.7200', 'a autora enfrenta ato administrativo praticado pela União, por meio da Secretaria de Patrimônio da União - SPU, o qual determinou ao Cartório do 2º Of', 'Alegou a autora que a União teria proposto, em 2008, a ação reivindicatória n.\r\n2008.72.00.014827-6 contra \"Taba S/A Empreendimentos Imobiliários Ltda\" (sic) visando reaver o aludido imóvel.', '372298371318', '2019-11-20 17:38:49', '2019-11-20 17:38:49'),
