(1247, 8, 1, 'PAJ 2019/031-02972', 'Comunidade Quilombola Aldeira - Imbituba/SC', 'Trata-se de famílias em condição de hipossuficiência, as quais enfrentam\r\ncotidianamente muitas dificuldades. Com base nos relatos coletados, pudemos observar que tais\r\ndificuldades derivam da inexistência de políticas públicas voltadas ao desenvolvimento local. Tais\r\npolíticas deveriam adotar como diretriz a execução de ações pautadas no respeito à preservação da\r\ncultura de comunidades tradicionais. Conforme mencionamos, as queixas apresentadas remontam\r\num contexto o qual envolve diversos direitos garantidos pela Constituição Federal, que são eles:\r\nsaúde, educação, lazer, acessibilidade, entre outros os quais a competência cabe ao Município, ao\r\nEstado e à União. O impacto gerado pela insuficiente oferta frente as demandas vem refletindo\r\nnegativamente na qualidade mínima de vida destas pessoas, ainda que por vezes tenham buscado o\r\nauxílio das três esferas por meio de denúncias e requerimentos.', 'undefined', '2019-11-21 19:53:57', '2019-11-21 19:53:57'),
