(1297, 1, 1, '1.33.005.000628/2019-87', 'Irregularidade em Rancho de Pesca', 'Trata o presente do Ofício n° 1587/2019 MPF/101/1, Procedimento Preparatório n° 1.33.005.000628/2019-87, nos seguintes termos:\r\n\r\n\"Cumprimentando-o cordialmente, a fim de instruir o procedimento em epígrafe, com fundamento na Constituição, art. 129, III, e na Lei Complementar 75/93, art. 8°, tendo\r\nem vista a notícia de construção/reforma irregular de rancho, localizado na Rua Ademar José da Rosa, às margens do rio, em Balneário Barra do Sul/SC (anexa), solicito que informe quais medidas foram adotadas e se foi realizada vistoria na área, encaminhando a documentação\r\npertinente.\r\n\r\nAssinalo, para tanto, o prazo de 30 dias.\"', 'undefined', '2019-12-04 17:31:09', '2019-12-04 17:31:09'),
(1298, 2, 4, '5029491-82.2019.4.04.7200', 'ÁREA DE PRESERVAÇÃO PERMANENTE', 'o Ministério Público Federal ingressou com a Ação Civil Pública nº 5029491-\r\n82.2019.4.04.7200, em face da União, Município de São José e Outros, em trâmite na Sexta Vara\r\nFederal da Subseção Judiciária de Florianópolis, tendo por objeto, a restauração do meio ambiente\r\ndegradado na bacia do Rio Maruim, em virtude do lançamento de efluentes não-tratados, do depósito de\r\nresíduos sólidos e da ocupação ilegal ao longo das margens do Rio Maruim, no Município de São José.\r\nAinda, busca a responsabilização solidária do Município de São José, da Fundação Municipal\r\ndo Meio Ambiente e Desenvolvimento Sustentável de São José (FMADS), da Casan e da União, por sua\r\nomissão ou atuação ineficiente/deficiente quanto ao dever de fiscalização, bem como a imposição de\r\nobrigação de fazer, consistente na adoção de todas as medidas afetas ao seu Poder de Polícia\r\nadministrativa.', '767969840119', '2019-12-05 14:18:50', '2019-12-05 14:18:50'),
