(1322, 9, 4, '5024718-88.2019.4.04.7201', 'Informação em Mandado de Segurança', 'Trata-se de mandado de segurança impetrado por CMO Construção e Montagem Offshore S.A. em face do Superintendente da Secretaria de Patrimônio da União em Santa Catarina visando a que se determine à autoridade impetrada que promova o cálculo de valor para cobrança de cessão de espaço aquático de acordo com o art. 11-B da Lei nº 9.636/1998 e do § 4º do art. 33 da IN 05/2018, considerando a Pauta de Valores da Terra Nua 2019 do INCRA para São Francisco do Sul e a aplicação da equação prevista no art. 33 da IN 05/2018.\r\n\r\nO pedido de liminar foi indeferido e a autoridade impetrada (Superintendente) foi notificada, Ofício de Notificação (5548731), para que preste informações no prazo de 10 (dez) dias.\r\n\r\nO pedido de Liminar está relacionado com as decisões proferidas no processo SEI-ME nº 04972.205753/2015-68.', '677893427519', '2019-12-13 16:44:14', '2019-12-13 16:44:14'),
(1323, 3, 4, '5001812-83.2019.4.04.7208', 'Sirvo-me do presente para encaminhar o PARECER DE FORÇA EXECUTÓRIA n. 00031/2019 /GEPAM/PUSC/PGU/AGU, anexo, atestando a força executória do acórdão d', 'Sirvo-me do presente para encaminhar o PARECER DE FORÇA EXECUTÓRIA n. 00031/2019\r\n/GEPAM/PUSC/PGU/AGU, anexo, atestando a força executória do acórdão do Superior Tribunal de Justiça,\r\nque julgou improcedentes os pedidos autorais, reconhecendo a legalidade da citação realizada por edital no\r\nprocesso administrativo demarcatório, bem como do procedimento adotado no caso para majoração da taxa de\r\nocupação, não existindo qualquer óbice (neste processo) para a cobrança das receitas patrimoniais sob o RIP\r\n5537 0000022-73 e solicitando que informe se existem débitos em aberto a título de taxa de ocupação, com resposta\r\naté 15/01/2020.', '406416534219', '2019-12-13 21:00:28', '2019-12-13 21:00:28'),
