(1334, 3, 4, '5006998-58.2017.4.04.7208', 'efetuar o depósito à disposição do juízo da 3ª Vara Federal da Subseção Judiciária de Itajaí, do montante de R$ 952,00 (novecentos e cinquenta e dois)', 'Pelo presente, solicito os bons préstimos desse d. órgão, no sentido de adotar as medidas necessárias junto\r\na Pasta da Economia para efetuar o depósito à disposição do juízo da 3ª Vara Federal da Subseção Judiciária de Itajaí, do\r\nmontante de R$ 952,00 (novecentos e cinquenta e dois) reais, a título pagamento do tradutor, nos termos da proposta do\r\nEvento 251, em cumprimento aos r. despachos dos Eventos 210, 257 e 262. Saliento que, nada obstante o recurso de lei,\r\nna r. decisão do Evento 262, foi fixada multa de R$ 500,00 (quinhentos reais) por dia em caso de descumprimento e foi\r\nestabelecido o prazo de cinco dias para tanto. Ante o eventual prejuízo à União, já que os atos materiais para o\r\ncumprimento da decisão merecem ser tomados independente do recurso próprio, o caso requer o pronto depósito da verba.\r\nPor fim, informo que a causa trata de ação civil pública movida pelo MPF em razão de acessão física pelos particulares\r\nem área non edificandi e que a União atua no polo passivo ao fundamento da sua responsabilidade omissiva para conter a\r\ndegradação ambiental da área, mas que a CONJUR do Ministério do Meio Ambiente entendeu não se tratar de matéria das\r\natribuições daquela Pasta, nos termos do Despacho constante do sequencial 374 do NUP 00553.002337/2017-51.', '616140328417', '2019-12-18 19:50:55', '2019-12-18 19:50:55'),
(1336, 2, 1, '5003632-62.2013.4.04.7204', 'Construções em terreno de marinha e acrescidos de marinha', 'Informar se os loteamentos em debate se sobrepõem a terrenos de marinha, destacando a área de incidência, bem como indicando quais quadras e lotes que se encontram em área de domínio da União, em relação a cada loteamento.\nInformar se a LPM encontra-se homologada, sendo que, em caso negativo, informe a fase em que o processo se encontra.\nInformar se as áreas informadas por Elói Kurrle Pegoraro e Edith Margot Grafulha se sobrepõem a terrenos de domínio da União.', 'undefined', '2019-12-19 13:56:59', '2019-12-19 13:56:59'),
