(1348, 2, 4, '5002480-30.2019.4.04.7216', 'Dano Ambiental', '“Trata-se de ação civil pública através da qual o MPF postula a demolição integral de\r\nedificação(ões), a remoção e adequada destinação final de todo o material decorrente da\r\ndemolição e a recuperação integral do meio ambiente através da elaboração e implementação\r\nde Projeto de Recuperação de Área Degradada – PRAD. Requer, ainda, o pagamento de\r\nindenização pelos danos ambientais intercorrentes, em razão do tempo que o ambiente deixou de\r\nprestar suas funções ecossistêmicas, além do patrocínio em jornal de divulgação regional da\r\npublicação da sentença.\r\nSubsidiariamente, postula o pagamento de indenização pelos danos ambientais causados.\r\nEm sede de tutela antecipada, postula que o(s) proprietário(s) não promova(m) novas\r\nintervenções no(s) imóvel(is) ou em áreas adjacentes, bem como afixe(m) placa(s) pedagógica(s)\r\nem frente à(s) edificação(ões), sob pena de multa diária. Pleiteia, também, que o Município de\r\nLaguna se abstenha de autorizar novas intervenções no(s) imóvel(is) ou novas edificações em\r\náreas de preservação permanente na Praia do Ypuã.\r\nAlega o MPF, em síntese, que a(s) casa(s) de veraneio na Praia do Ypuã, em Laguna/SC,\r\nestá(ão) situada(s) em área de preservação permanente - APP (dunas com vegetação de\r\nrestinga), área de preservação ambiental - APA da Baleia Franca e terreno ou acrescido de\r\nmarinha, tendo sido erigida(s) sem autorização do órgão ambiental competente. Assevera que o\r\nMunicípio de Laguna e a União foram omissos e ineficientes no exercício', '914081906019', '2020-01-03 17:27:10', '2020-01-03 17:27:10'),
