(1361, 2, 1, '5011266-87.2019.4.04.7208', 'ZONA COSTEIRA E OUTROS', 'Informo que o Instituto de Desenvolvimento e Integração Ambiental –IDEIA\r\ningressou com a Ação Civil Pública nº 5011266-87.2019.4.04.7208, em face da União, Município de\r\nBalneário Camboriú/ S C e Outros, em trâmite na Terceira Vara Federal da Subseção Judiciária de\r\nItajaí, tendo por objeto, em sede de liminar: 1) suspender a eficácia do Contrato de Adesão nº 15/2019,\r\nfirmado entre a União Federal, por intermédio do Ministério da Infraestrutura, e a empresa PDBS – Ports\r\nDeveloped By Shiphandlers Participações Ltda., com a intervenção da Agência Nacional de Transportes\r\nAquaviários – ANTAQ, tendo por objeto a autorização de construção e exploração de instalação portuária\r\nde turismo do empreendimento “BC Port”, em Balneário Camboriú, situada em área do mar territorial\r\nsob a administração da União Federal; e 2) suspender a eficácia da Licença Ambiental Prévia nº\r\n11.091/2018, concedida pelo Instituto do Meio Ambiente de Santa Catarina – IMA para instalação\r\nportuária de turismo do empreendimento “BC Port”, em Balneário Camboriú, situada em área do mar\r\nterritorial sob a administração da União Federal, abstendo-se o órgão estadual, inclusive, de conceder\r\nlicença ambiental de instalação.\r\nDiante do exposto, solicito, de modo a preservar os interesses da União no referido\r\nprocesso, se digne determinar à área técnica competente o fornecimento, a esta Procuradoria-Seccional\r\nda União em Chapecó, de subsídios fáticos e jurídicos em prol da defesa da referida ação. Diante da\r\nexiguidade do prazo judicial solicito sejam referidas informações encaminhadas até o dia 06.02.2020,\r\npreferencialmente pela via eletrônica através do seguinte endereço: psu.cco@agu.gov.br.', '104105835719', '2020-01-09 19:30:52', '2020-01-09 19:30:52'),
