(1800, 3, 1, '5013538-44.2020.4.04.7200', 'Regularização de ocupação', 'Trata-se de ação em que o autor objetiva: \n1) seja assegurado ao Autor, em face dos Réus, o direito de construir no imóvel; \n2) seja assegurado o pleno exercício da posse pelo Autor; \n3) sejam levantados todos e quaisquer embargos judiciais resultantes da ação civil pública (fase de cumprimento de sentença) autuada sob o nº 5008067- 23.2015.4.04.7200; 4) seja garantido o direito de propriedade do Autor sobre o imóvel em questão, inclusive se evitando medidas tais como o cancelamento da matrícula; \n5) sucessivamente, com relação ao subitem b.4, seja autorizada a utilização do imóvel pelo Autor, mediante regularização junto à Secretaria de Patrimônio da União, através do recolhimento do foro ou da taxa de ocupação; \n6) Seja concedida tramitação prioritária ao presente feito em função da idade do Autor, conforme documento de identificação anexo; \n7) Seja distribuída por dependência a ação em destaque, por conta da propositura da ação nº 5008067-23.2015.4.04.7200 (fase cumprimento de\nsentença)', '994125769120', '2020-07-06 16:10:20', '2020-07-06 16:10:20'),
