(1921, 3, 4, '5009780-43.2014.4.04.7208', 'Cobrança de Taxa de Ocupação', 'procedimento de correção dos valores foi refeito dando conhecimento e possibilidade de defesa ao interessado e, posteriormente, não havendo contestação, foram realizadas as cobrança.\r\n\"Por este motivo, cientificada a interessada quanto ao novo procedimento, em atenção ao mencionado no Ofício 1293/2016 que \"em relação a cobrança de diferença de valores retroativos. Eventuais valores que foram pagos a menor, seja em razão da liminar, seja em razão indefinição em relação aos exatos valores a serem cobrados. Podem ser exigidas diferenças, retroativa a 2007, desde que haja notificação prévia conforme determinado pelo TRF 4ª Região. Exceção feita ao exercício 2013, no qual foi dada quitação em decisão transitada em julgado.\", efetuamos o novo lançamento para os exercícios de 2007 a 2012 e 2014 pelos valores atualizados, mantendo 2013 pelo IPCA-e e quitado.\"', 'undefined', '2020-08-17 09:55:06', '2020-08-17 09:55:06'),
