(1927, 3, 4, '5001479-73.2020.4.04.7216', 'TERRENO DE MARINHA', 'Trata-se de análise da força executória da decisão proferida nos autos da ação judicial\r\n5001479-73.2020.4.04.7216 promovida por JOSE PEDRO PACHECO SIROTSKY, ANA CRISTINA SCHEIN DIAS e\r\nOUTROS, em face da UNIÃO.\r\nO processo versa sobre pedido de tutela de urgência antecipada incidental ajuizada por dependência à\r\nação de Procedimento Comum nº 5000009-07.2020.404.7216, em que os autores postulam a concessão de prazo para\r\natendimento a notificações promovidas em processos administrativos instaurados pela União em cumprimento à ACP nº\r\n5000295-97.2011.4.04.7216.', '825928424320', '2020-08-18 11:04:52', '2020-08-18 11:05:24'),
(1928, 9, 4, '5015448-09.2020.4.04.7200', 'Solicita conclusão do processo 04972.203885/2015-55', 'Trata-se de Mandado de Segurança impetrado por ANA ALICE FERNANDES em face do (a) Superintendente da Secretaria de Patrimônio da União - UNIÃO - ADVOCACIA GERAL DA UNIÃO - Florianópolis em que a parte impetrante objetiva a concessão de liminar \"determinando à autoridade Impetrada que analise e conclua o requerimento n. 04972.203885/2015-55 apresentado pela Impetrante em 17/05/2017, num prazo de 10 (dez) dias, sob pena de multa diária;\"\r\n\r\nO Juiz indeferiu o pedido de liminar e determinou que fosse notificada a autoridade impetrada, no caso a SPU, para prestar informações no prazo de 10 dias.\r\n\r\nIsso posto, considerando que o processo administrativo está no SPU-SC-NUPRIV para análise, encaminho a esse Núcleo e à Coordenação para que prestem as informações.', 'undefined', '2020-08-18 15:34:39', '2020-08-18 15:34:39'),
