(1933, 3, 1, '5001377-66.2020.4.04.7211', 'Desocupação de área - Caçador/SC', 'Trata-se de ação visando a desocupação de área em que a ré reside e a remoção da edificação construída no local.\nO Município alegou que pretende implementar um projeto de urbanização na área, denominado Parque Linear na cidade de Caçador/SC, sobre a faixa de domínio da linha ferroviária. Informou que o projeto foi autorizado pela Agência Nacional dos Transportes Terrestres - ANTT, pelo Departamento Nacional de Infraestrutura de Transportes - DNIT e pela Rumo Malha Sul S.A., concessionária do serviço público. Sustentou que a ré edificou moradia no local e se\nrecusa a desocupá-lo.', '166995509120', '2020-08-19 20:21:05', '2020-08-19 20:21:05'),
