(1935, 3, 2, '5009890-32.2015.4.04.7200', 'Terreno de marinha', 'Cientifica acerca da baixa dos autos à origem, bem como acerca do acórdão cujo link está contido no Evento 119 dos autos, que ressaltou no Voto o seguinte: \"Ressalva-se, entretanto, que, considerando que as obras foram realizadas em terreno de marinha (conforme demonstrado no laudo pericial juntado no evento 2, LAUDPERI68, do processo originário), que o julgamento deste processo não impede a SPU de praticar os atos administrativos pertinentes às ocupações.\" Assim, de acordo com o decidido pelo egrégio Tribunal Regional Federal da Quarta Região, a SPU/SC, no caso específico, pode praticar os atos administrativos pertinentes às ocupações.', '986257611715', '2020-08-20 16:10:56', '2020-08-20 16:10:56'),
