(1949, 3, 1, '5001383-73.2020.4.04.7211', 'Parque Linear na cidade de Caçador/SC', 'Trata-se de ação ajuizada pelo Município de Caçador em face de Marli Terezinha Tamanho Correa, na qual pediu a concessão de tutela de urgência que determine a desocupação de área em que a ré reside e a remoção da edificação construída no local, a ser cumprida no prazo de 15 dias. O Município alegou que pretende implementar um projeto de urbanização na área, denominado Parque Linear na cidade de Caçador/SC, sobre a faixa de domínio da linha ferroviária. Informou que o projeto foi autorizado pela Agência Nacional dos Transportes Terrestres - ANTT, pelo Departamento Nacional de Infraestrutura de Transportes - DNIT e pela Rumo Malha Sul S.A., concessionária do serviço público. Sustentou que a ré edificou moradia no local e se recusa a desocupá-lo.', '680093539220', '2020-08-25 14:39:15', '2020-08-25 14:39:15'),
