(2108, 3, 1, '5010396-08.2020.4.04.7208', 'Inscrição de ocupação', 'Solicita subsídios de fato e de direito para a interposição de eventual recurso da União nos autos em epígrafe, que Vossa Senhoria responde diretamente na qualidade de autoridade impetrada. Ou seja, além das informações encaminhadas ao juízo, sejam encaminhados a esta Procuradoria da União informações aptas a demonstrar a insuficiência ou deficiência das assertivas constantes da petição inicial. Dentre as diversas afirmações do impetrante, algumas são no \nsentido de que não tomou ciência do conteúdo dos expedientes administrativos que determinavam a regularização da ocupação, com documentos aptos para tanto.', 'undefined', '2020-10-28 14:04:27', '2020-10-28 14:04:27'),
