(2119, 6, 2, '2020.0074792-DPF/JTVE/SC', 'Fiscalização - Vistoria - São Francisco do Sul/SC', 'Solicita encaminhamento dos documentos produzidos acerca da realização de vistoria e/ou adoção de providências pertinentes solicitados pela Procuradoria da República no Município de Joinville, através do ofício n\" 852/2020 MPF/JOLl de 22/05/2020, tendo em vista a notícia de invasão e construção irregular de muro em terras de marinha e em área de mangue, localizada na Vila da Glória, era São Francisco do Sul, na rua pavimentada de asfalto, prolongamento da Rua Lindolfo de Freitas, próximo ao número 4500, em frente à Pousada Avenir.', 'undefined', '2020-11-06 06:56:31', '2020-11-06 06:56:31'),
