(2121, 3, 2, '0005099-57.2008.8.24.0282', 'Empreendimentos Balneário do Farol LTDA', 'A embargante ocupa uma área de terras de marinha de 2.040.570,00m2, registrada na SPU sob RIP n. 817300000008-71 (proc. 90-80-008500-03), sem que tenha havido qualquer pagamento a título de Taxa de Ocupação ou a título de laudêmio, nos termos dos Decretos-leis n. 9.760/46 e n. 2.398/87.\nNão há registro de que a executada tenha comunicado a SPU/SC acerca de eventuais ocupações ou transferências, tampouco de pedido de revisão cadastral e ou financeira. Tal inércia lhe convém, na medida comercializa áreas loteadas (inclusive sobre dunas) sem a devida comunicação à SPU e o recolhimento prévio de laudêmio.', '467668731820', '2020-11-06 14:18:42', '2020-11-06 14:18:42'),
