(2135, 3, 1, '5002131-90.2020.4.04.7216', 'Manifestação de interesse - Rancho de pesca - Garopaba/SC', 'Cuida-se de ação civil pública ajuizada pelo Ministério Público do Estado de Santa Catarina perante a Vara Única da Comarca de Garopaba - atualmente em tramite na 1ª Vara Federal de Laguna - contra Leonildo Peirão, pescador artesanal/profissional, objetivando a demolição de rancho de pesca localizado na Praia do Ouvidor e a recuperação da degradação ambiental correspondente. Como defesa, o réu apresentou contestação, na qual, entre outras questões, alegou que em 2001 requereu a emissão de Termo de Autorização de Uso Sustentável (TAUS) perante a SPU (evento 2, TRASLADO1, fls. 89/98).\nNo Evento 5, o MM. Juiz intimou a União para manifestar ou não interesse no feito e prestar informações atualizadas quanto ao procedimento SPU/SC 05022.000253/2001-38.', 'undefined', '2020-11-12 14:19:12', '2020-11-12 14:19:12'),
(2136, 3, 2, '00405.000125/2014-91', 'Contrato de Cessão - MUNICÍPIO DE ARARANGUÁ/SC', 'Em fiscalização realizada pela Controladoria-Geral da União, da qual resultou o Relatório de Fiscalização n. 38050/2013, o referido órgão constatou que o município de Araranguá estava ocupando área superior à cedida gratuitamente pela União. A União cedeu 3.850m² do imóvel objeto da Matrícula 62.731 do Cartório de Registro de Imóveis de Araranguá, mas a municipalidade ocupou 6.321,25m².', 'undefined', '2020-11-12 15:30:57', '2020-11-12 15:30:57'),
