(2229, 3, 1, '5004545-52.2019.8.24.0023', 'Ação de desapropriação -', 'Ação proposta por Estado de Santa Catarina, com objetivo da imissão provisória na posse da área objeto de expropriação, sustentando, em suma, a utilidade pública e a urgência na ocupação do imóvel para fins de construção do acesso ao novo terminal do Aeroporto Hercílio Luz. Aduz, de início, que a ação não envolve a desapropriação de imóvel de propriedade da União (terreno de marinha), mas tão somente a expropriação do domínio útil do particular sobre o imóvel aforado.', '386793253019', '2021-01-25 17:47:11', '2021-01-25 17:47:11'),
(2230, 3, 1, '5000265-58.2007.8.24.0023', 'ASSOCIAÇÃO ATLÉTICA PONTAS DAS CANAS -  regularização', 'A União Federal foi intimada na ação de cumprimento de sentença n. 5000265-58.2007.8.24.0023 em trâmite na 3ªVara da Fazenda Pública de Florianópolis. Em apertado resumo, trata-se de ação movida pelo MPSC em face da ASSOCIAÇÃO ATLÉTICA PONTAS DAS CANAS visando a regularização do funcionamento do imóvel junto aos órgãos públicos.', '100561859420', '2021-01-25 18:05:02', '2021-01-25 18:05:02'),
(2231, 6, 1, '2020.0121558-SR/PF/SC', 'Terreno de marinha - Carianos', 'Em atenção à determinação de GERMANO DI CIERO MIRANDA , Delegado(a) de Polícia Federal e visando instruir os autos do caso IPL 2020.0121558-SR/PF/SC , solicita que informe se a área localizada na na Servidão Valdomiro Júlio Gonçalves, bairro Carianos, FIorianópoIis/SC (Coordenadas UTM - DATUM WGS84 - 22J 0743189/6938122) incide em terreno de marinha e seus acrescidos.', 'undefined', '2021-01-26 19:19:40', '2021-01-26 19:19:40'),
